import React, { Component } from "react";
import Welcome from "./Welcome.js";
const bandsURL = "http://localhost:3000/";
class Home extends Component {
  fetchdata = () => {
    fetch(bandsURL)
      .then(res => res.json())
      .then(data => console.log(data));
  };

  render() {
    return <div>{this.fetchdata}</div>;
  }
}
export default Home;
